<!DOCTYPE html>
<html class="no-js">
<head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
    <title>errfield - web error reporting and performance analysis</title>
    <meta name="description" content="">
    <meta name="viewport" content="width=device-width">
    <style>
    	body {
    		background:#dcdcdc;
    		font-family:Arial,Helvetica,sans-serif;
    		font-size: 14px;
    	}
    	#wrapper {
    		width:300px;
    		margin:10px auto;
    		background:black;
    	}
    	#header {
			width: 300px;
			height: 190px;
			border-bottom:1px solid rgba(255,255,255,0.3);
			background-color:#090909;
			background-repeat: no-repeat;
			background-position: center center;
			background-image: url('data:image/jpg;base64,');
		}
		h1 {
			color:white;
			text-align: center;
		}
		form {
			color:white!important;
			padding:15px;
		}
		label {
			display:block;
			clear:both;
		}
		input {
			display: block;
			clear:both;
			margin-bottom:22px;
			width:98%;
			height:30px;
			font-size:15px;
			background:rgba(255,255,255,0.9);
			-moz-transition:all 0.2s ease-in;
			-webkit-transition: all 0.2s ease-in;
			-o-transition: all 0.2s ease-in;
			transition: all 0.2s ease-in;
		}
		input:focus, input:hover {
			background: white;
		}		
		input[type="submit"] {
			-moz-transition:all 0.2s ease-in;
			-webkit-transition: all 0.2s ease-in;
			-o-transition: all 0.2s ease-in;
			transition: all 0.2s ease-in;			
			margin:0 auto;
			font-size:15px;
			width: 222px;
			height: 60px;
			border: 1px solid #4d4d4d;
			background-color: #090909;
			background-image: url(data:image/svg+xml;base64,);
			background-image: -moz-linear-gradient(bottom, #292929 0%, #4e4e4e 100%);
			background-image: -o-linear-gradient(bottom, #292929 0%, #4e4e4e 100%);
			background-image: -webkit-linear-gradient(bottom, #292929 0%, #4e4e4e 100%);
			background-image: linear-gradient(bottom, #292929 0%, #4e4e4e 100%);
			color:white;
		}
		input[type="submit"]:hover {
			border: 1px solid #4d4d4d;
			background-color: #090909;
			background-image: url(data:image/svg+xml;base64,);
			background-image: -moz-linear-gradient(bottom, #3b3b3b 0%, #4e4e4e 100%);
			background-image: -o-linear-gradient(bottom, #3b3b3b 0%, #4e4e4e 100%);
			background-image: -webkit-linear-gradient(bottom, #3b3b3b 0%, #4e4e4e 100%);
			background-image: linear-gradient(bottom, #3b3b3b 0%, #4e4e4e 100%);		
		}
    </style>
</head>
<body>

	<div id="wrapper">
		<div id="header"></div>